import React from 'react';
import { AppBar, Toolbar, Typography} from '@material-ui/core';

const Navbar = () => {
    return (
        <AppBar position="static">
            <Toolbar>
                <Typography>This is our header</Typography>
            </Toolbar>
        </AppBar>
    )
};

export default Navbar;
